fix(Static Module, Summary Field): Remove placeholder content from initial value.

### What is the problem?

I forgot to remove the placeholder content from the Summary field initial value. It shouldn't be there.

### Why does the problem happen?

The placeholder value on the field and placeholder content are 2 different concept.

**Placeholder value** is the default value that we want to display on the **field setting** when the field is "empty". For example, if you go to Title Text Size field option, the `26px` there is default value and displayed as placeholder of the input field.

**Placeholder content** is basically the initial value that will be used when the module is initially added. For example, if you add Audio module, "Your Title Goes Here" text is automatically used on Title text. Here, the "Your Title Goes Here" text is field value, not placeholder (default) value. User can enable disable this behavior by disabling "Add Placeholder Content To New Modules" on the Builder settings.

So, we just need to define the "default value a.k.a. placeholder value" here, not "placeholder content". So, if I remove this one it should works as I explained below.

Right now the Summary field has "This is a brief summary that provides an overview of the content below. It can span multiple lines to give readers a comprehensive understanding of what to expect in the main content section." text as default value that will be displayed as placeholder text.

### How the fix works

The goal of this PR is to display the placeholder value on the **Summary field on Static Module settings**  when the value is "empty":
- Visually or user perspective, the "empty" here means there is no value set on the field.
- Technically, the "empty" here means either:
  - The value is set as empty string
  - The value is reset which means we're back to use the default value (not just empty string).

**Illustration of set empty string**

The "value" is just empty string "".

```
attrs: {
  "summary": {
  "innerContent": {
    "desktop": {
      "value": ""
    }
  }
},
```

**Illustration of reset field (remove attribute)**

The "value" is back to default value.

```
attrs: {
  "summary": {
  "innerContent": {
    "desktop": {
      "value": "This is a brief summary that provides an overview of the content below. It can span multiple lines to give readers a comprehensive understanding of what to expect in the main content section."
    }
  }
},
```

Here the latest video:

https://github.com/user-attachments/assets/cca08644-4e0e-41fd-9873-5683a119c225

In the video above, I do some steps:

**Add Static Module**

When I add the Static module, the "default value" is displayed as "placeholder value" on the Text area of Summary field. The rendered module also display the "default value" in the VB layout.

**Reset Field Value (Back to Default)**

Next, I set certain value, then I reset the field. Since reset means back to default value, now the Text area field shows the "default value" as placeholder again and the rendered module also display the "default value" in the VB layout, just like when we add the Static module.

**Delete Field Value (Empty String)**

Finally, I set certain value again, but this time I will delete the value on the field. Since delete means we will set the value as empty string (not reset to use the default value), the Text area field will also show the "default value" as placeholder again, but the rendered module will display the empty string in the VB layout.

Why this happen? Because the `showPlaceholderOnEmpty` is a property of the Text area component to show default value as placeholder when the field is empty. This property doesn't have any correlation with the rendered element. So, this is expected behavior.

How if 3P devs want to change the behavior where they want to display? They can simply modify the module attribute like this:

```
  // When summary is reset, placeholder is displayed since reset restores default value.
  // When summary is empty, placeholder is hidden since empty string indicates intentional user action.
  // To modify this behavior, developers can update the summary attribute with a default value during module render.
  if ('' === attrs?.summary?.innerContent?.desktop?.value) {
    elements.attrs = {
      ...elements.attrs,
      summary: {
        ...elements.attrs.summary,
        innerContent: {
          desktop: {
            value: staticMetadata?.attributes?.summary?.default?.innerContent?.desktop?.value ?? '',
          },
        },
      },
    };
  }
```

The code above will make the rendered module layout display the default value when the value is empty.

https://github.com/user-attachments/assets/48a4a9ce-74f2-41cd-9fc4-8e2c2778156e

However, since that is not D5 default behavior on how empty string works, the code will be added only as comment in case 3P devs want to use the same approach.

fix(D5, Dynamic Module, Settings): convert the settings-advanced.tsx file of Dynamic Module into auto generated module settings.

### Convert Advanced Panel Into Auto Generated Module Settings

There are some actions needed to make sure we can properly convert all the module settings inside the `settings-advanced.tsx` file of Dynamic Module into auto generated module settings.

#### Enable Auto Generated Module Settings on Advanced Panel

First, we need to enable auto generated module settings on Advanced panel by defining `advanced: 'auto'` in the `settings` of the `module.json` file.

```
"settings": {
  "advanced": "auto"
}
```

The code above will make all the module settings inside Advanced panel are generated automatically. Since, we don't do any conversion yet on the `settings-advanced.tsx` file, you will see Advanced panel is empty or throw error now.

#### Converting The `settings-advanced.tsx` File

Now, let's move to the `settings-advanced.tsx` file and convert each settings one by one.

**CSS ID & Classes Group**

Original code:

```
<IdClassesGroup />
```

CSS ID & Classes group including their fields are basically built-in module settings and commonly used. They will be converted by enabling the settings on module level attribute and the definition will be declared in `attributes.module.settings` of the `module.json` file:

```
"attributes": {
  "module": {
    "settings": {
      "advanced": {
        "htmlAttributes": {},
        // ... other `optionAttributes` ...
      },
      // ... other `elementPart` ...
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add CSS ID & Classes group and their related fields to the Advanced panel.

**Custom CSS Group**

Original code:

```
<CssGroup
  mainSelector=".example_dynamic_module"
/>
```

Custom CSS group including their fields are basically built-in module settings and commonly used. They will be converted by enabling the settings on metadata level attribute and the definition will be declared with `customCssFields: {}` of the `module.json` file:

```
"customCssFields": {},
// ... other module metadata properties ...
```

**Visibility, Transition, Position, and Scroll Settings Groups**

Original code:

```
<VisibilitySettingsGroup />
<TransitionGroup />
<PositionSettingsGroup />
<ScrollSettingsGroup />
```

Visibility, transition, position, and scroll settings fields are basically built-in module settings and commonly used. They will be converted by enabling the settings on module level attribute and the definition will be declared in `attributes.module.settings` of the `module.json` file:

```
"attributes": {
  "module": {
    "settings": {
      "decoration": {
        "overflow": {},
        "disabledOn": {},
        "transition": {},
        "position": {},
        "zIndex": {},
        "scroll": {},
        "sticky": {},
        // ... other `optionAttributes` ...
      },
      // ... other `elementPart` ...
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add visibility, transition, position, and scroll settings groups and their related fields to the Advanced panel.

#### Remove Unused Code and File

Once we convert all the module settings inside the `settings-advanced.tsx` file, we can safely remove the unused code and file.

In the `d5-extension-example-modules/src/components/dynamic-module/index.ts`:
- We can remove the `advanced` property of the `dynamicModule.settings`.
- Then, we can remove the `import { SettingsAdvanced } from './settings-advanced';` as well.

Finally, we can remove the `d5-extension-example-modules/src/components/dynamic-module/settings-advanced.tsx` file since we already convert it.

**Note**: The `<AttributesGroup />` is related to the button element for handling the `rel` HTML tag value. Meanwhile, the Dynamic Module doesn't have any button element and the `attributes` value is not being uesd here. So, we won't convert `<AttributesGroup />` and we will remove it.

Part of elegantthemes/Divi#41608.

fix(D5, Dynamic Module, Settings): convert the settings-design.tsx file of Dynamic Module into auto generated module settings.

Initially, all the module settings inside the `settings-design.tsx` file of Dynamic Module were generated manually with composable approach. In order to simplify the module creation and make sure those module settings are filterable for 3PS, we need to convert them into auto generated module settings.

### Convert Design Panel Into Auto Generated Module Settings

There are some actions needed to make sure we can properly convert all the module settings inside the `settings-design.tsx` file of Dynamic Module into auto generated module settings.

#### Enable Auto Generated Module Settings on Design Panel

First, we need to enable auto generated module settings on Design panel by defining `design: 'auto'` in the `settings` of the `module.json` file.

```
"settings": {
  "design": "auto"
}
```

The code above will make all the module settings inside Design panel are generated automatically. Since, we don't do any conversion yet on the `settings-design.tsx` file, you will see Design panel is empty or throw error now.

#### Converting The `settings-design.tsx` File

Now, let's move to the `settings-design.tsx` file and convert each settings one by one.

**Text Group**

Original code:

```
<TextGroup
  defaultGroupAttr={defaultSettingsAttrs?.module?.advanced?.text}
/>
```

Text group including their fields are basically built-in module settings and commonly used. They will be converted by enabling the settings on module level attribute and the definition will be declared in `attributes.module.settings` of the `module.json` file:

```
"attributes": {
  "module": {
    "settings": {
      "advanced": {
        "text": {},
        // ... other `optionAttributes` ...
      },
      // ... other `elementPart` ...
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add Text group and fields to the Design panel.

**Title Text Group**

Original code:

```
<FontGroup
  groupLabel={__('Title Text', 'd5-extension-example-modules')}
  attrName="title.decoration.font"
  fieldLabel={__('Title', 'd5-extension-example-modules')}
  defaultGroupAttr={defaultSettingsAttrs?.title?.decoration?.font?.asMutable({ deep: true }) ?? {}}
  fields={{
    headingLevel: {
      render: true,
    },
  }}
/>
```

Title Text group including their fields are basically built-in Font module settings and commonly used. They will be converted by enabling the settings on title level attribute and the definition will be declared in `attributes.title.settings` of the `module.json` file:

```
"attributes": {
  "title": {
    "settings": {
      "decoration": {
        "font": {
          "priority": 10,
          "component": {
            "props": {
              "groupLabel": "Title Text",
              "fieldLabel": "Title"
            }
          }
        }
      },
      // ... other `elementPart` ...
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add Title Text group and fields to the Design panel.

**Post Title Text Group**

Original code:

```
<FontGroup
  groupLabel={__('Post Title Text', 'd5-extension-example-modules')}
  attrName="postTitle.decoration.font"
  fieldLabel={__('Post Title', 'd5-extension-example-modules')}
  fields={{
    headingLevel: {
      render: true,
    },
  }}
  defaultGroupAttr={defaultSettingsAttrs?.postTitle?.decoration?.font?.asMutable({ deep: true }) ?? {}}
/>
```

Post Title Text group including their fields are basically built-in Font module settings and commonly used. They will be converted by enabling the settings on title level attribute and the definition will be declared in `attributes.postTitle.settings` of the `module.json` file:

```
"attributes": {
  "postTitle": {
    "settings": {
      "decoration": {
        "font": {
          "priority": 10,
          "component": {
            "props": {
              "groupLabel": "Post Title Text",
              "fieldLabel": "Post Title"
            }
          }
        }
      },
      // ... other `elementPart` ...
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add Post Title Text group and fields to the Design panel.

**Body Text Group**

Original code:

```
<FontBodyGroup />
```

Body Text group including their fields are basically built-in module settings and commonly used. They will be converted by enabling the settings on module level attribute and the definition will be declared in `attributes.module.settings` of the `module.json` file:

```
"attributes": {
  "module": {
    "settings": {
      "decoration": {
        "bodyFont": {}
      },
      // ... other `elementPart` ...
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add Body Text group and fields field to the Design panel.

**Sizing, Spacing, Border, Box Shadow, Filters, Transform, and Animation Groups**

Original code:

```
<SizingGroup />
<SpacingGroup
  defaultGroupAttr={defaultSettingsAttrs?.module?.decoration?.spacing?.asMutable({ deep: true }) ?? {}}
/>
<BorderGroup />
<BoxShadowGroup />
<FiltersGroup />
<TransformGroup />
<AnimationGroup />
```

Sizing, spacing, border, box shadow, filters, transform, and animation groups and their related fields are basically built-in module settings and commonly used. They will be converted by enabling the settings on module level attribute and the definition will be declared in `attributes.module.settings` of the `module.json` file:

```
"attributes": {
  "module": {
    "settings": {
      "decoration": {
        "sizing": {},
        "spacing": {},
        "border": {},
        "boxShadow": {},
        "filters": {},
        "transform": {},
        "animation": {},
        // ... other `optionAttributes` ...
      },
      // ... other `elementPart` ...
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add sizing, spacing, border, box shadow, filters, transform, and animation groups and their related felds to the Design panel.

#### Remove Unused Code and File

Once we convert all the module settings inside the `settings-design.tsx` file, we can safely remove the unused code and file.

In the `d5-extension-example-modules/src/components/dynamic-module/index.ts`:
- We can remove the `design` property of the `dynamicModule.settings`.
- Then, we can remove the `import { SettingsDesign } from './settings-design';` as well.

Finally, we can remove the `d5-extension-example-modules/src/components/dynamic-module/settings-design.tsx` file since we already convert it.

