fix(D5, Dynamic Module, Settings): convert the settings-content.tsx file of Dynamic Module into auto generated module settings.

### Convert Content Panel Into Auto Generated Module Settings

There are some actions needed to make sure we can properly convert all the module settings inside the `settings-content.tsx` file of Dynamic Module into auto generated module settings.

#### Enable Auto Generated Module Settings on Content Panel

First, we need to enable auto generated module settings on Content panel by defining `content: 'auto'` in the `settings` of the `module.json` file.

```
"settings": {
  "content": "auto"
}
```

The code above will make all the module settings inside Content panel are generated automatically. Since, we don't do any conversion yet on the `settings-content.tsx` file, you will see Content panel is empty or throw error now.

#### Converting The `settings-content.tsx` File

Now, let's move to the `settings-content.tsx` file and convert each settings one by one.

**Posts Group**

Original code:

```
<GroupContainer
  id="posts"
  title={__('Posts', 'd5-extension-example-modules')}
>
  {/* ... other code ... */}
</GroupContainer>
```

The Posts group will be converted into a new custom group and the definition will be declared in `settings.groups` of the `module.json` file:

```
"settings": {
  "groups": {
    "contentPosts": {
      "panel": "content",
      "priority": 10,
      "groupName": "contentPosts",
      "multiElements": true,
      "component": {
        "name": "divi/composite",
        "props": {
          "groupLabel": "Posts"
        }
      }
    }
  }
}
```

The code above will add Posts group to the Content panel. At this point, the Posts group is still empty and no module settings yet.

**Title Field**

Original code:

```
<FieldContainer
  attrName="title.innerContent"
  label={__('Title', 'd5-extension-example-modules')}
  description={__('Title to show for module.', 'd5-extension-example-modules')}
  features={{
    sticky: false,
  }}
>
  <TextContainer/>
</FieldContainer>
```

The Title field will be converted and the definition will be declared in `attributes.title.settings` of the `module.json` file:

```
"attributes": {
  "title": {
    "settings": {
      "innerContent": {
        "groupType": "group-item",
        "item": {
          "groupName": "contentPosts",
          "priority": 10,
          "render": true,
          "attrName": "title.innerContent",
          "label": "Title",
          "description": "Title to show for module.",
          "features": {
            "sticky": false,
            "dynamicContent": false
          },
          "component": {
            "name": "divi/text",
            "type": "field"
          }
        }
      }
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add Title field to the Posts group in the Content panel. Please note that since the original code doesn't have dynamic content enabled, we will disable it as well to make sure the result is identical.

**Number of Posts Field**

Original code:

```
<FieldContainer
  attrName="postItems.innerContent"
  subName="postsNumber"
  label={__('Number of posts', 'd5-extension-example-modules')}
  description={__('Number of posts you want to show.', 'd5-extension-example-modules')}
  features={{
    sticky: false,
    hover: false,
    responsive: false,
  }}
  defaultAttr={defaultSettingsAttrs?.postItems?.innerContent}
>
  <TextContainer />
</FieldContainer>
```

The Number of Posts field will be converted and the definition will be declared in `attributes.postItems.settings` of the `module.json` file:

```
"attributes": {
  "postItems": {
    "settings": {
      "innerContent": {
        "groupType": "group-items",
        "items": {
          "src": {
            "groupSlug": "contentPosts",
            "priority": 20,
            "render": true,
            "subName": "postsNumber",
            "label": "Number of posts",
            "description": "Number of posts you want to show.",
            "features": {
              "sticky": false,
              "dynamicContent": false
            },
            "component": {
              "name": "divi/text",
              "type": "field"
            }
          }
        }
      }
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add Number of Posts field to the Posts group in the Content panel. Please note that since the original code doesn't have dynamic content enabled, we will disable it as well to make sure the result is identical.

**Link, Background, and Admin Label Groups**

Original code:

```
<LinkGroup/>
```

Link, Background, and Admin Label groups including their fields are basically built-in module settings and commonly used. They will be converted by enabling the settings on module level attribute and the definition will be declared in `attributes.module.settings` of the `module.json` file:

```
"attributes": {
  "module": {
    "settings": {
      "meta": {
        "adminLabel": {}
      },
      "advanced": {
        "link": {}
      },
      "decoration": {
        "background": {}
      }
    },
    // ... other element properties ...
  }
  // ... other `elementAttributes` ...
}
// ... other module metadata properties ...
```

The code above will add Link, Background, and Admin Label groups and their fields to the Content panel.

#### Remove Unused Code and File

Once we convert all the module settings inside the `settings-content.tsx` file, we can safely remove the unused code and file.

In the `d5-extension-example-modules/src/components/dynamic-module/index.ts`:
- We can remove the `content` property of the `dynamicModule.settings`.
- Then, we can remove the `import { SettingsContent } from './settings-content';` as well.

Finally, we can remove the `d5-extension-example-modules/src/components/dynamic-module/settings-content.tsx` file since we already convert it.

Part of elegantthemes/Divi#41608.
